import React, { useState } from "react";
import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';

const AboutUs = () => {
    return (
        <section>
            <Container fluid>
                <Row>
                    <Col>
                    <img src="././img/Ligaspiel.jpg" className="img-fluid"></img>
                    </Col>
                    <Col>
                    <p>Some text lorem console.error</p>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}


export default AboutUs;
